import React from 'react'

import {FormGroup,FormControl,InputLabel, Input,styled,Button,Typography} from '@mui/material/';


const Container= styled(FormGroup)`
width:50%;
margin:5% auto 0 auto;
> div{
     margin-top:15px;
    color:#a86b4c;
}
`

function AddUsers() {
  return (
    <>
       <Container>
       <Typography variant="h3" gutterBottom>ADDUSER</Typography>
        <FormControl>
            <InputLabel>Name</InputLabel>
            <Input onChange={()=>onchangevalue()} name='name'></Input>
        </FormControl>
        <FormControl>
            <InputLabel>UserName</InputLabel>
            <Input onChange={()=>onchangevalue()} name='username'></Input>
        </FormControl>
        <FormControl>
            <InputLabel>Email</InputLabel>
            <Input onChange={()=>onchangevalue()} name='email'></Input>
        </FormControl>
        <FormControl>
            <InputLabel>Phone</InputLabel>
            <Input onChange={()=>onchangevalue()} name='phone'></Input>
        </FormControl>
        <FormControl>
        <Button variant="contained">AddUser</Button> 
        </FormControl>
       </Container>
    </>
  )
}

export default AddUsers;
